DROP DATABASE IF EXISTS imdb;
CREATE DATABASE imdb;
USE imdb;

DROP TABLE IF EXISTS movie;
CREATE TABLE movie (
  id VARCHAR(10) NOT NULL,
  title VARCHAR(200) DEFAULT NULL,
  year INT DEFAULT NULL,
  date_published DATE DEFAULT NULL,
  duration INT,
  country VARCHAR(250),
  worlwide_gross_income VARCHAR(30),
  languages VARCHAR(200),
  production_company VARCHAR(200),
  PRIMARY KEY (id)
);

DROP TABLE IF EXISTS genre;
CREATE TABLE genre (
  movie_id VARCHAR(10) NOT NULL,
  genre VARCHAR(20) NOT NULL,
  PRIMARY KEY (movie_id, genre)
);

DROP TABLE IF EXISTS director_mapping;
CREATE TABLE director_mapping (
  movie_id VARCHAR(10) NOT NULL,
  name_id VARCHAR(10) NOT NULL,
  PRIMARY KEY (movie_id, name_id)
);

DROP TABLE IF EXISTS role_mapping;
CREATE TABLE role_mapping (
  movie_id VARCHAR(10) NOT NULL,
  name_id VARCHAR(10) NOT NULL,
  category VARCHAR(10),
  PRIMARY KEY (movie_id, name_id)
);

DROP TABLE IF EXISTS names;
CREATE TABLE names (
  id VARCHAR(10) NOT NULL,
  name VARCHAR(100) DEFAULT NULL,
  height INT DEFAULT NULL,
  date_of_birth DATE DEFAULT NULL,
  known_for_movies VARCHAR(100),
  PRIMARY KEY (id)
);

DROP TABLE IF EXISTS ratings;
CREATE TABLE ratings (
  movie_id VARCHAR(10) NOT NULL,
  avg_rating DECIMAL(3,1),
  total_votes INT,
  median_rating INT,
  PRIMARY KEY (movie_id)
);

-- **4. Vytvorenie dimenzionálnych tabuliek**
CREATE OR REPLACE TABLE dim_movies AS
SELECT 
    id AS movie_id,
    title,
    year,
    duration,
    country,
    languages,
    production_company
FROM movie;

CREATE OR REPLACE TABLE dim_genres AS
SELECT DISTINCT 
    movie_id,
    genre
FROM genre;

CREATE OR REPLACE TABLE dim_directors AS
SELECT 
    dm.movie_id,
    n.name AS director_name,
    n.date_of_birth
FROM director_mapping dm
JOIN names n ON dm.name_id = n.id;

CREATE OR REPLACE TABLE dim_actors AS
SELECT 
    rm.movie_id,
    n.name AS actor_name,
    n.height,
    n.date_of_birth
FROM role_mapping rm
JOIN names n ON rm.name_id = n.id
WHERE rm.category = 'actor';

CREATE OR REPLACE TABLE dim_dates AS
SELECT 
    DISTINCT DATE_PART('year', date_published) AS year,
    DATE_PART('month', date_published) AS month,
    DATE_PART('day', date_published) AS day,
    date_published AS full_date
FROM movie
WHERE date_published IS NOT NULL;

-- **5. Vytvorenie faktovej tabuľky**
CREATE OR REPLACE TABLE fact_movies AS
SELECT 
    m.id AS movie_id,
    COALESCE(r.avg_rating, 0) AS avg_rating,
    COALESCE(r.total_votes, 0) AS total_votes,
    COALESCE(r.median_rating, 0) AS median_rating,
    m.worlwide_gross_income
FROM movie m
LEFT JOIN ratings r ON m.id = r.movie_id;

-- **6. Vytvorenie pohľadov (views)**
CREATE OR REPLACE VIEW view_avg_rating_by_genre AS
SELECT 
    g.genre,
    AVG(f.avg_rating) AS avg_rating,
    COUNT(DISTINCT f.movie_id) AS num_movies
FROM fact_movies f
JOIN (SELECT DISTINCT movie_id, genre FROM dim_genres) g ON f.movie_id = g.movie_id
GROUP BY g.genre
ORDER BY avg_rating DESC;

SELECT * FROM view_avg_rating_by_genre;


CREATE OR REPLACE VIEW view_total_gross_by_year AS
SELECT 
    DATE_PART('year', m.date_published) AS year,
    SUM(TRY_TO_NUMBER(REPLACE(m.worlwide_gross_income, '$', ''))) AS total_gross
FROM movie m
WHERE m.worlwide_gross_income IS NOT NULL
  AND TRY_TO_NUMBER(REPLACE(m.worlwide_gross_income, '$', '')) IS NOT NULL
GROUP BY DATE_PART('year', m.date_published)
ORDER BY year;

SELECT * FROM view_total_gross_by_year;



CREATE OR REPLACE VIEW view_num_movies_by_year AS
SELECT 
    DATE_PART('year', m.date_published) AS year,
    COUNT(m.id) AS num_movies
FROM movie m
WHERE m.date_published IS NOT NULL
GROUP BY DATE_PART('year', m.date_published)
ORDER BY year;

SELECT * FROM view_num_movies_by_year;

CREATE OR REPLACE VIEW view_top_10_movies AS
SELECT 
    m.title AS movie_title,
    DATE_PART('year', m.date_published) AS release_year,
    r.avg_rating AS average_rating,
    r.total_votes AS total_votes
FROM movie m
JOIN ratings r ON m.id = r.movie_id
ORDER BY r.avg_rating DESC
LIMIT 10;

SELECT * FROM view_top_10_movies;

CREATE OR REPLACE VIEW view_num_movies_by_genre AS
SELECT 
    g.genre,
    COUNT(g.movie_id) AS num_movies
FROM genre g
GROUP BY g.genre
ORDER BY num_movies DESC;

SELECT * FROM view_num_movies_by_genre;



CREATE OR REPLACE STAGE imdb_stage;

COPY INTO movie
FROM @imdb_stage/movie.csv  
FILE_FORMAT = (TYPE = 'CSV' SKIP_HEADER = 1)  
ON_ERROR = 'CONTINUE';

COPY INTO genre 
FROM @imdb_stage/genre.csv  
FILE_FORMAT = (TYPE = 'CSV' SKIP_HEADER = 1)  
ON_ERROR = 'CONTINUE';  

COPY INTO director_mapping 
